import React from "react";
import Mycontacts from "../components/Contents/ContactContents/Mycontacts";
import FooterTag from "../components/Layout/FooterTag";

const Contact = () => {
  return (
    <React.Fragment>
        <Mycontacts />
        <FooterTag />
    </React.Fragment>
  );
};

export default Contact;
